import{_ as t,o as e,c as n,Q as o}from"./chunks/framework.e5ba4c7f.js";const m=JSON.parse('{"title":"Incoming Transactions","description":"","frontmatter":{},"headers":[],"relativePath":"tabs-and-screens/incoming-trx.md","filePath":"tabs-and-screens/incoming-trx.md"}'),a={name:"tabs-and-screens/incoming-trx.md"},r=o('<h1 id="incoming-transactions" tabindex="-1">Incoming Transactions <a class="header-anchor" href="#incoming-transactions" aria-label="Permalink to &quot;Incoming Transactions&quot;">​</a></h1><p>Use the <strong>Incoming Transactions</strong> tab to view and interact with the list of incoming transactions.</p><h2 id="accessibility" tabindex="-1">Accessibility <a class="header-anchor" href="#accessibility" aria-label="Permalink to &quot;Accessibility&quot;">​</a></h2><p>By default, this tab is only accessible by users with the <a href="./../roles.html#manager">Manager</a> role.</p><h2 id="on-this-tab" tabindex="-1">On this tab <a class="header-anchor" href="#on-this-tab" aria-label="Permalink to &quot;On this tab&quot;">​</a></h2><ul><li><strong>Incoming Transactions</strong> table — contains a list of all incoming transactions to the bank’s main account. The table contains the following fields: <ul><li><strong>View</strong> — contains the <strong>Details</strong> button for each record. Selecting <strong>Details</strong> opens the <strong>Transaction Details</strong> screen containing all the available information on the transaction.</li><li><strong>Trx Hash</strong> — the unique hash ID of a transaction in the Iroha network.</li><li><strong>External Reference</strong> — an ID number of a third-party document serving as a reason for the transaction.</li><li><strong>Entry Date</strong> — the exact time and date of when a transaction occurred.</li><li><strong>From Account</strong> — the Account ID of an account that is specified as a sender.</li><li><strong>To Account</strong> — the Account ID of an account that is specified as a receiver.</li><li><strong>CCY</strong> — the currency of a transaction.</li><li><strong>Amount</strong> — the exact amount that has been transfered.</li><li><strong>Status</strong> — the current status of a transaction at the moment of observing.</li></ul></li><li><strong>Calendar</strong> bar — allows to filter the results of the <strong>Incoming Transactions</strong> table by dates.</li><li><strong>Export</strong> button — allows to export the contents of the <strong>Mobile Users</strong> table as a <code>.csv</code> file.</li><li><strong>Search</strong> bar — allows to search the contents of the <strong>Mobile Users</strong> table.<br> The bar supports letters, numeric values, and dates in the YYYY-MM-DD format (e.g., 2022-10-31).</li></ul><h2 id="exporting-table-contents" tabindex="-1">Exporting table contents <a class="header-anchor" href="#exporting-table-contents" aria-label="Permalink to &quot;Exporting table contents&quot;">​</a></h2><p>To export the contents of the <strong>Mobile Users</strong> table, perform the following steps:</p><ol><li>Select <strong>Export</strong>. The <strong>Export a report</strong> window appears.</li><li>Select <strong>Start Date</strong>. The <strong>Calendar</strong> window appears.</li><li>Scroll through the calendar to find the starting date of the time period that you are interested in and select it (DD/MM/YYYY; e.g., 11/01/2022).<br> The chosen date is input into the <strong>Start Date</strong> field; the <strong>End Date</strong> field is now active.</li><li>Scroll through the calendar to find the ending date of the time period that you are interested in and select it (DD/MM/YYYY; e.g., 11/11/2022).<br> The chosen date is input into the <strong>End Date</strong> field; the <strong>Calendar</strong> window disappears.</li><li>Select <strong>Export CSV</strong>.<br> The resulting <code>.csv</code> file is downloaded to your computer.</li></ol><h2 id="accessing-transaction-details" tabindex="-1">Accessing transaction details <a class="header-anchor" href="#accessing-transaction-details" aria-label="Permalink to &quot;Accessing transaction details&quot;">​</a></h2><p>To see detailed information on a transaction, select <strong>Details</strong> in the <strong>View</strong> field next to the required record. After that, the <strong>Transaction Details</strong> screen appears. The screen contains the following data:</p><ul><li><strong>Transaction ID</strong> — internal ID of a transaction.</li><li><strong>Source Account ID</strong> — Account ID of a sender.</li><li><strong>Destination Account ID</strong> — Account ID of a receiver.</li><li><strong>Destination Full name</strong> — full name of the receiver as he is registered in Bokolo.</li><li><strong>Source Bank Participant Code</strong> — unique Participant Code of the sender’s bank in Bokolo network.</li><li><strong>Source Bank Name</strong> — full name of the sender’s bank in Bokolo Network.</li><li><strong>Destination Bank Participant Code</strong> — unique Participant Code of the receiver’s bank in Bokolo network.</li><li><strong>Destination Bank Name</strong> — full name of the receiver’s bank in Bokolo Network.</li><li><strong>Currency Name</strong> — name of the currency used in the transaction.</li><li><strong>Creation Time</strong> — the exact date and time of when a transaction occurred (server’s time).</li><li><strong>Transaction Daytime</strong> — the exact date and time of when a transaction occurred (GMT time).</li><li><strong>Source Phone number</strong> — phone number of the sender.</li><li><strong>Destination Phone number</strong> — phone number of the receiver.</li><li><strong>Source Wallet Type</strong> — the type of the wallet that the sender has used for the transaction.</li><li><strong>Destination Wallet Type</strong> — the type of the wallet of the receiver.</li><li><strong>Status</strong> — the current status of a transaction at the moment of observing.</li><li><strong>Hash of Transaction</strong> — the unique hash ID of a transaction in the Iroha network.</li><li><strong>Asset ID</strong> — the unique ID of the currency in the Iroha network.</li><li><strong>Amount</strong> — the exact amount that was transfered.</li><li><strong>Transfer from (phone)</strong> — the phone number of a specified sender of the transaction; the receiver of the transaction will see the specified phone number as the sender of the transaction.</li><li><strong>Transfer from (name)</strong> — the name of a specified sender of the transaction; the receiver of the transaction will see the specified full name as the sender of the transaction.</li><li><strong>Transaction Type</strong> — the type of a transaction (e.g., <strong>Send</strong>/<strong>Pay</strong>).</li></ul>',12),s=[r];function i(l,c,h,g,d,f){return e(),n("div",null,s)}const p=t(a,[["render",i]]);export{m as __pageData,p as default};
